Set in the future on a distant planet, Avatar spins a simple little parable about greedy colonizers (that would be mankind) messing up the lush tribal world of Pandora.

A paraplegic Marine named Jake (Sam Worthington) acts through a 9-foot-tall avatar that allows him to roam the planet and pass as one of the Na'vi, the blue-skinned, large-eyed native people who would very much like to live their peaceful lives without the interference of the visitors. &lt;a href=&quot;
